	 * client.Bridge.update('brg-65dhjbanasiei', {
	 * 	bridgeAudio: false
	 * }, function (err, response) {
	 * 		if(err) {
	 * 			console.log(err);
	 * 		}
	 * 		else {
	 * 			console.log(response);
	 * 		}
	 * 	});
	 *
	 * @example
	 * // end bridge
	 * var bridgeOptions = {
	 * 	callIds: []
	 * };
	 *
	 * client.Bridge.update("{bridgeId}", bridgeOptions)
	 * .then(function () {
	 * 	// continue
	 * });
	 *
	 * @example
	 * // Add two calls to bridge then remove one
	 * var bridgeOptions = {
	 * 	bridgeAudio : true,
	 * 	callIds: ["{callId1}","{callId2}"]
